export default function Home() {
  const [, setLocation] = useLocation();
  const [searchLocation, setSearchLocation] = useState("");
  const [budget, setBudget] = useState("");
  
  // Fetch all properties to calculate real city data
  const { data: properties = [], isLoading } = useQuery<Property[]>({
    queryKey: ["/api/properties"],
  });

  // Calculate real city data from actual properties
  const cityData = cityTemplates.map(template => {
    const cityProperties = properties.filter(property => 
      property.city.toLowerCase() === template.name.toLowerCase()
    );
    const pgCount = cityProperties.length;
    const startingRent = pgCount > 0 ? Math.min(...cityProperties.map(p => p.rent)) : 0;
    
    return {
      ...template,
      pgCount,
      startingRent
    };
  });

  const handleCityClick = (cityName: string) => {
    setLocation(`/city-map?city=${encodeURIComponent(cityName)}`);
  };

  const handleSearch = () => {
    // Navigate to city map with search filters
    const params = new URLSearchParams();
    if (searchLocation) params.set('search', searchLocation);
    if (budget) params.set('budget', budget);
    
    // Extract city from search location or use default
    const cityFromSearch = searchLocation.split(',').pop()?.trim() || 'Bangalore';
    params.set('city', cityFromSearch);
    
    setLocation(`/city-map?${params.toString()}`);
  };

  const handleKeyPress = (e: React.KeyboardEvent) => {
    if (e.key === 'Enter') {
      handleSearch();
    }
  };

  return (
    <div>
      {/* Hero Section */}
      <div className="relative gradient-bg">
        <div className="absolute inset-0 bg-black bg-opacity-40"></div>
        <div className="relative max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-24">
          <div className="text-center">
            <h1 className="text-4xl md:text-6xl font-bold text-white mb-6">
              Find Your Perfect PG
            </h1>
            <p className="text-xl text-gray-200 mb-8 max-w-3xl mx-auto">
              Discover verified PG accommodations with smart roommate matching. Safe, affordable, and convenient housing solutions across India.
            </p>
            
            {/* Search Bar */}
            <div className="max-w-2xl mx-auto">
              <div className="bg-white dark:bg-gray-900 rounded-xl shadow-lg p-2 flex flex-col md:flex-row gap-2">
                <div className="flex-1">
                  <Input
                    type="text"
                    placeholder="Search location (e.g., Koramangala, Bangalore)"
                    value={searchLocation}
                    onChange={(e) => setSearchLocation(e.target.value)}
                    onKeyPress={handleKeyPress}
                    className="border-0 focus-visible:ring-0 focus-visible:ring-offset-0"
                  />
                </div>
                <div className="flex gap-2">
                  <Select value={budget} onValueChange={setBudget}>
                    <SelectTrigger className="w-40">
                      <SelectValue placeholder="Budget" />
                    </SelectTrigger>
                    <SelectContent>
                      <SelectItem value="5000-10000">5,000 - 10,000</SelectItem>
                      <SelectItem value="10000-15000">10,000 - 15,000</SelectItem>
                      <SelectItem value="15000-20000">15,000 - 20,000</SelectItem>
                      <SelectItem value="20000+">20,000+</SelectItem>
                    </SelectContent>
                  </Select>
                  <Button onClick={handleSearch} className="px-6">
                    <Search className="mr-2 h-4 w-4" />
                    Search
                  </Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Metro Cities Section */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-16">
        <div className="text-center mb-12">
          <h2 className="text-3xl font-bold text-gray-900 dark:text-white mb-4">
            Explore PGs in Major Cities
          </h2>
          <p className="text-lg text-gray-600 dark:text-gray-400">
            Browse cities and discover available accommodations
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 xl:grid-cols-4 gap-6">
          {cityData.map((city) => (
            <CityCard
              key={city.name}
              name={city.name}
              pgCount={city.pgCount}
              startingRent={city.startingRent}
              imageUrl={city.imageUrl}
              onClick={() => handleCityClick(city.name)}
            />
          ))}
        </div>
      </div>

      {/* Features Section */}
      <div className="bg-white dark:bg-gray-900 py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-12">
            <h2 className="text-3xl font-bold text-gray-900 dark:text-white mb-4">
              Why Choose NestMatch?
            </h2>
            <p className="text-lg text-gray-600 dark:text-gray-400">
              Experience the future of PG hunting with our smart features
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            <div className="text-center">
              <div className="bg-primary/10 w-16 h-16 rounded-full flex items-center justify-center mx-auto mb-4">
                <Users className="text-primary text-2xl h-8 w-8" />
              </div>
              <h3 className="text-xl font-semibold text-gray-900 dark:text-white mb-2">
                Smart Roommate Matching
              </h3>
              <p className="text-gray-600 dark:text-gray-400">
                Our AI algorithm matches you with compatible roommates based on lifestyle, interests, and habits.
              </p>
            </div>

            <div className="text-center">
              <div className="bg-secondary/10 w-16 h-16 rounded-full flex items-center justify-center mx-auto mb-4">
                <Shield className="text-secondary text-2xl h-8 w-8" />
              </div>
              <h3 className="text-xl font-semibold text-gray-900 dark:text-white mb-2">
                Verified Properties
              </h3>
              <p className="text-gray-600 dark:text-gray-400">
                All PGs are verified with proper documentation and safety checks for your peace of mind.
              </p>
            </div>

            <div className="text-center">
              <div className="bg-warning/10 w-16 h-16 rounded-full flex items-center justify-center mx-auto mb-4">
                <MapPin className="text-warning text-2xl h-8 w-8" />
              </div>
              <h3 className="text-xl font-semibold text-gray-900 dark:text-white mb-2">
                Location Intelligence
              </h3>
              <p className="text-gray-600 dark:text-gray-400">
                Find PGs near your workplace, college, or preferred areas with our smart location features.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
